CREATE DEFINER=`root`@`localhost` PROCEDURE `logs`(IN `start_date` DATE, IN `end_date` DATE)
BEGIN
	DECLARE crt_date DATE;
	DECLARE emp_id VARCHAR(10);
	DECLARE emp_shift VARCHAR(50);
	DECLARE emp_rest VARCHAR(50);	
	DECLARE ctr INT(50);	
	DECLARE ctr1 INT(50);	
	SET crt_date=start_date;
	SET @ctr=1;
	SET @ctr1=1;

	WHILE (SELECT COUNT(*) FROM employee) != (@ctr-1) DO
		WHILE crt_date < end_date DO
			WHILE (SELECT MAX(employee_id) AS employee_id FROM employee) != (@ctr1-1) DO
				IF(SELECT COUNT(*) FROM employee WHERE employee_id=@ctr1) > 0 THEN
					SELECT employee_id, employee_shift, employee_restday INTO @emp_id, @emp_shift, @emp_rest FROM employee WHERE employee_id=@ctr1;
				ELSE
					SELECT 0;
				END IF;
				SET @ctr1 = @ctr1 + 1;
			END WHILE;
			SET @ctr1 = 1;
			SET @ctr = @ctr + 1;
			SET crt_date = ADDDATE(crt_date, INTERVAL 1 DAY);
		END WHILE;
	END WHILE;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `newEmpLogs`(IN `start_date` DATE, IN `end_date` DATE, IN `emp_id` INT)
BEGIN
	DECLARE crt_date DATE;
	DECLARE emp_shift VARCHAR(50);
	DECLARE emp_rest VARCHAR(50);		
	SET crt_date=start_date;

	WHILE crt_date < end_date DO
		SELECT employee_shift, employee_restday INTO @emp_shift, @emp_rest FROM employee WHERE employee_id=emp_id;
		SET crt_date = ADDDATE(crt_date, INTERVAL 1 DAY);
	END WHILE;
END$$

